% lpMPC - a fast interior point code generated by FORCES
%
%   OUTPUT = lpMPC(PARAMS) solves a multistage problem
%   subject to the parameters supplied in the following struct:
%       PARAMS.f01 - column vector of length 4
%       PARAMS.lb01 - column vector of length 4
%       PARAMS.ub01 - column vector of length 4
%       PARAMS.C01 - matrix of size [2 x 4]
%       PARAMS.e01 - column vector of length 2
%       PARAMS.f02 - column vector of length 4
%       PARAMS.lb02 - column vector of length 4
%       PARAMS.ub02 - column vector of length 4
%       PARAMS.C02 - matrix of size [2 x 4]
%       PARAMS.e02 - column vector of length 2
%       PARAMS.f03 - column vector of length 4
%       PARAMS.lb03 - column vector of length 4
%       PARAMS.ub03 - column vector of length 4
%       PARAMS.C03 - matrix of size [2 x 4]
%       PARAMS.e03 - column vector of length 2
%       PARAMS.f04 - column vector of length 4
%       PARAMS.lb04 - column vector of length 4
%       PARAMS.ub04 - column vector of length 4
%       PARAMS.C04 - matrix of size [2 x 4]
%       PARAMS.e04 - column vector of length 2
%       PARAMS.f05 - column vector of length 4
%       PARAMS.lb05 - column vector of length 4
%       PARAMS.ub05 - column vector of length 4
%       PARAMS.C05 - matrix of size [2 x 4]
%       PARAMS.e05 - column vector of length 2
%       PARAMS.f06 - column vector of length 4
%       PARAMS.lb06 - column vector of length 4
%       PARAMS.ub06 - column vector of length 4
%       PARAMS.C06 - matrix of size [2 x 4]
%       PARAMS.e06 - column vector of length 2
%       PARAMS.f07 - column vector of length 4
%       PARAMS.lb07 - column vector of length 4
%       PARAMS.ub07 - column vector of length 4
%       PARAMS.C07 - matrix of size [2 x 4]
%       PARAMS.e07 - column vector of length 2
%       PARAMS.f08 - column vector of length 4
%       PARAMS.lb08 - column vector of length 4
%       PARAMS.ub08 - column vector of length 4
%       PARAMS.C08 - matrix of size [2 x 4]
%       PARAMS.e08 - column vector of length 2
%       PARAMS.f09 - column vector of length 4
%       PARAMS.lb09 - column vector of length 4
%       PARAMS.ub09 - column vector of length 4
%       PARAMS.C09 - matrix of size [2 x 4]
%       PARAMS.e09 - column vector of length 2
%       PARAMS.f10 - column vector of length 4
%       PARAMS.lb10 - column vector of length 4
%       PARAMS.ub10 - column vector of length 4
%       PARAMS.C10 - matrix of size [2 x 4]
%       PARAMS.e10 - column vector of length 2
%       PARAMS.f11 - column vector of length 4
%       PARAMS.lb11 - column vector of length 4
%       PARAMS.ub11 - column vector of length 4
%       PARAMS.C11 - matrix of size [2 x 4]
%       PARAMS.e11 - column vector of length 2
%       PARAMS.f12 - column vector of length 4
%       PARAMS.lb12 - column vector of length 4
%       PARAMS.ub12 - column vector of length 4
%       PARAMS.C12 - matrix of size [2 x 4]
%       PARAMS.e12 - column vector of length 2
%       PARAMS.f13 - column vector of length 4
%       PARAMS.lb13 - column vector of length 4
%       PARAMS.ub13 - column vector of length 4
%       PARAMS.C13 - matrix of size [2 x 4]
%       PARAMS.e13 - column vector of length 2
%       PARAMS.f14 - column vector of length 4
%       PARAMS.lb14 - column vector of length 4
%       PARAMS.ub14 - column vector of length 4
%       PARAMS.C14 - matrix of size [2 x 4]
%       PARAMS.e14 - column vector of length 2
%       PARAMS.f15 - column vector of length 2
%       PARAMS.lb15 - column vector of length 2
%       PARAMS.ub15 - column vector of length 2
%       PARAMS.e15 - column vector of length 2
%
%   OUTPUT returns the values of the last iteration of the solver where
%       OUTPUT.z1 - column vector of size 4
%       OUTPUT.z2 - column vector of size 4
%       OUTPUT.z3 - column vector of size 4
%       OUTPUT.z4 - column vector of size 4
%       OUTPUT.z5 - column vector of size 4
%       OUTPUT.z6 - column vector of size 4
%       OUTPUT.z7 - column vector of size 4
%       OUTPUT.z8 - column vector of size 4
%       OUTPUT.z9 - column vector of size 4
%       OUTPUT.z10 - column vector of size 4
%       OUTPUT.z11 - column vector of size 4
%       OUTPUT.z12 - column vector of size 4
%       OUTPUT.z13 - column vector of size 4
%       OUTPUT.z14 - column vector of size 4
%       OUTPUT.z15 - column vector of size 2
%
%   [OUTPUT, EXITFLAG] = lpMPC(PARAMS) returns additionally
%   the integer EXITFLAG indicating the state of the solution with 
%       1 - Optimal solution has been found (subject to desired accuracy)
%       0 - Maximum number of interior point iterations reached
%      -7 - Line search could not progress
%
%   [OUTPUT, EXITFLAG, INFO] = lpMPC(PARAMS) returns 
%   additional information about the last iterate:
%       INFO.it        - number of iterations that lead to this result
%       INFO.res_eq    - max. equality constraint residual
%       INFO.res_ineq  - max. inequality constraint residual
%       INFO.pobj      - primal objective
%       INFO.dobj      - dual objective
%       INFO.dgap      - duality gap := pobj - dobj
%       INFO.rdgap     - relative duality gap := |dgap / pobj|
%       INFO.mu        - duality measure
%       INFO.sigma     - centering parameter
%       INFO.lsit_aff  - iterations of affine line search
%       INFO.lsit_cc   - iterations of line search (combined direction)
%       INFO.step_aff  - step size (affine direction)
%       INFO.step_cc   - step size (centering direction)
%       INFO.solvetime - Time needed for solve (wall clock time)
%
% See also LICENSE
